import React from 'react';
import './App.css';

const styles = {
  main: {
    backgroundColor: 'skyblue',
    width: '100vw',
    height: '100vh',
    display: 'flex'
  },
  saveBox: {
    // position: 'absolute',
    justifyContent: 'center',
    alignItems: 'center',
    border: '1px gray solid',
    width: '20%',
    height: '20%'
  }
};

function App() {
  return (
    <div className="App">
      <div style={styles.main}>
        <div style={styles.saveBox}>List</div>
      </div>
    </div>
  );
}

export default App;
